import React, { Component } from 'react'
import Typography from '@material-ui/core/Typography'
import Button from '@material-ui/core/Button'
import { Link } from '@material-ui/core'

export default class LandingPage extends Component {
	render() {
		return (
			<div style={styles.landingDiv}>
				<Typography style={styles.Typography} align='center' variant="h2" component="h2">
					Hello! I'm <span style={styles.name}>Mekhala Joshi</ span>.<br />
					I'm a full-stack web developer.<br />
					{/* <Link style={styles.link} onClick={() => this.props.onClick('two')}>here</Link> */}
					{/* <Button onClick={() => this.props.onClick('two')} variant="outlined" color="secondary" style={styles.Button}> */}
					<button onClick={() => this.handleClick('three')} id='Third-Link'>
						View my work
					</button>
					{/* </Button> */}
				</Typography>
			</div>
		)
	}
}

const styles = {
	landingDiv: {
		width: '70%',
		height: '710px',
		margin: 'auto',
		// backgroundColor: ' rgba(40, 44, 52, 0)',

	},
	Typography: {
		color: '#fff',
		margin: '0',
		position: 'absolute',
		top: '50%',
		left: '50%',
		fontSize: '3vw',
		transform: 'translate(-50%, -50%)',
	},
	name: {
		// color: '#d71559',
		color: '#f5c000',
		// textShadow: '2px 2px #f5c000',
		fontWeight: '400',
	},
	Button: {
		color: 'white',
		outline: 'none',
		textTransform: 'none',
		fontSize: '1.5vw',
		border: '1px ridge #6DF3F3',
		borderRadius: '0px',
	},
	link: {
		color: '#f5c000',
		borderRadius: '5px',
		display: grid,
		gridTemplateRows: '2fr 1fr',
		gridGap: '10px',
		cursor: pointer,
		border: '3px dotted white',
		transition: 'all 0.6s',
		height: '100%',
		width: 'auto',
	},
}
